function initialize_UI()
{
	$("#savexml").hide();
	
	$('#savexml').click(function(e){
	});
	
	$('.btn-file :file').on('fileselect', function(event, file, label) {	 
		
        var reader = new FileReader();

        reader.onload = function(e) {
			$('#iocxml').val(reader.result);
			load_xml();
		};
        
        reader.readAsText(file);
        
    });
	
	$(document)
    .on('change', '.btn-file :file', function() {
        var input = $(this),
            numFiles = input.get(0).files ? input.get(0).files.length : 1,
            label = input.val().replace(/\\/g, '/').replace(/.*\//, '');
        input.trigger('fileselect', [input.get(0).files[0], label]);
	});
		
	populateMenus();
}

function populateMenus()
{
	//console.log(iocterms.ioctermlist['ArpEntryItem'].iocterm[0].text);
	
	var network_items = ['Network','PortItem','ArpEntryItem','DnsEntryItem','RouteEntryItem','Snort'];
	var email_items = ['Email'];
	var disk_items = ['DiskItem','VolumeItem'];
	var driver_items = ['DriverItem'];
	var system_items = ['SystemInfoItem','SystemRestoreItem'];
	var process_items = ['ProcessItem'];
	var task_items = ['TaskItem'];
	var user_items = ['UserItem'];
	var file_items = ['FileItem','PrefetchItem'];
	var registry_items = ['RegistryItem'];
	var service_items = ['ServiceItem','EventLogItem','HiveItem'];
	var module_items = ['ModuleItem','HookItem'];
	
	var cookiehistory_items = ['CookieHistoryItem'];
	var urlhistory_items = ['UrlHistoryItem'];
	var formhistory_items = ['FormHistoryItem'];
	var filedownloadhistory_items = ['FileDownloadHistoryItem'];

	
	appendListWithData($("#driverItemsMenu"), driver_items);
	appendListWithData($("#userItemsMenu"), user_items);
	appendListWithData($("#networkItemsMenu"), network_items);
	appendListWithData($("#emailItemsMenu"), email_items);
	appendListWithData($("#systemItemsMenu"), system_items);
	appendListWithData($("#diskItemsMenu"), disk_items);
	
	appendListWithData($("#registryItemsMenu"),registry_items);
	appendListWithData($("#serviceItemsMenu"),service_items);
	appendListWithData($("#moduleItemsMenu"),module_items);
	appendListWithData($("#processItemsMenu"),process_items);
	appendListWithData($("#taskItemsMenu"),task_items);
	appendListWithData($("#fileItemsMenu"),file_items);
	
	appendListWithData($("#cookieItemsMenu"), cookiehistory_items);
	appendListWithData($("#urlItemsMenu"), urlhistory_items);
	appendListWithData($("#formItemsMenu"), formhistory_items);
	appendListWithData($("#filedownloadItemsMenu"), filedownloadhistory_items);
}

function appendListWithData(uiElement, groups)
{
	if( groups == null || uiElement == null )
		return;
	
	var list = uiElement.append('<ul class="dropdown-menu" role="menu"></ul>').find('ul');
	
	groups.forEach(function(item){
		
		var li_var = '<li><a href="#">' + item + '</a></li>';
    	list.append(li_var);

    	var innerList = null;
    	var ioctermlist = iocterms.ioctermlist[item];
		for(var i=0; i<ioctermlist.iocterm.length; i++)
		{
			//console.log(iocterms.ioctermlist[item].iocterm[0].text);
			
    		if( i == 0)
    		{
    			innerList = list.append('<ul></ul>').find('ul:last');
    		}
    		
    		var splitTo = ioctermlist.iocterm[i].text.indexOf('/');
    		var iocsearch = [ioctermlist.iocterm[i].text.slice(0,splitTo), ioctermlist.iocterm[i].text.slice(splitTo+1)];
    		
    		ioc_text_to_title_map[ioctermlist.iocterm[i].text] = ioctermlist.iocterm[i].title;
    		
    		var innerli_var = '<li><a href="#" onclick="ioc_create_item(\'' + ioctermlist.iocterm[i].title + '\',\'' 
    		+ iocsearch[0] + '\',\'' + iocsearch[1] + '\',\'' + ioctermlist.iocterm[i]['display-type'] + '\');">' + ioctermlist.iocterm[i].title + '</a></li> ';
    		
    		innerList.append(innerli_var);

		}
	});
}

